        return(
            <div>
              <div>
              {localStorage.getItem("isAdmin")? <AdminNavbar/>: <Navbar/>}
                </div>  
           
            <div>
                email:<h1>ramallah-Bookshops@gamil.com</h1>
                phone:<h1>12345679</h1>
            </div>
            </div> 
        )
    }

}
export default contact;
